import React from 'react';
import { Typography, Paper, Box, Grid, Card, CardContent, CardMedia, Button, useTheme } from '@mui/material';
import { motion } from 'framer-motion';
import GitHubIcon from '@mui/icons-material/GitHub';
import LaunchIcon from '@mui/icons-material/Launch';

const projects = [
  {
    title: 'Portfolio Website',
    description: 'A modern portfolio website built with React and Material-UI',
    image: 'https://via.placeholder.com/300x200',
    github: 'https://github.com/yourusername/portfolio',
    demo: 'https://your-portfolio-demo.com',
    technologies: ['React', 'Material-UI', 'TypeScript'],
  },
  {
    title: 'E-commerce Platform',
    description: 'Full-stack e-commerce platform with payment integration',
    image: 'https://via.placeholder.com/300x200',
    github: 'https://github.com/yourusername/ecommerce',
    demo: 'https://your-ecommerce-demo.com',
    technologies: ['React', 'Node.js', 'MongoDB'],
  },
  // Add more projects as needed
];

const Projects: React.FC = () => {
  const theme = useTheme();

  return (
    <motion.div
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.5 }}
    >
      <Paper 
        elevation={3} 
        sx={{ 
          p: 4, 
          mb: 4,
          background: 'linear-gradient(135deg, rgba(255,255,255,0.9) 0%, rgba(255,255,255,0.7) 100%)',
          backdropFilter: 'blur(10px)',
        }}
      >
        <Typography 
          variant="h4" 
          gutterBottom
          sx={{
            background: `linear-gradient(45deg, ${theme.palette.primary.main}, ${theme.palette.secondary.main})`,
            WebkitBackgroundClip: 'text',
            WebkitTextFillColor: 'transparent',
            fontWeight: 700,
            mb: 4,
          }}
        >
          Projects
        </Typography>

        <Grid container spacing={4}>
          {projects.map((project, index) => (
            <Grid item xs={12} md={6} key={index}>
              <motion.div
                whileHover={{ scale: 1.02 }}
                transition={{ type: "spring", stiffness: 300 }}
              >
                <Card 
                  sx={{ 
                    height: '100%',
                    display: 'flex',
                    flexDirection: 'column',
                    background: 'rgba(255,255,255,0.5)',
                    backdropFilter: 'blur(10px)',
                  }}
                >
                  <CardMedia
                    component="img"
                    height="200"
                    image={project.image}
                    alt={project.title}
                  />
                  <CardContent sx={{ flexGrow: 1 }}>
                    <Typography gutterBottom variant="h5" component="h2">
                      {project.title}
                    </Typography>
                    <Typography variant="body1" color="text.secondary" paragraph>
                      {project.description}
                    </Typography>
                    <Box sx={{ mb: 2 }}>
                      {project.technologies.map((tech, techIndex) => (
                        <Typography
                          key={techIndex}
                          variant="caption"
                          sx={{
                            mr: 1,
                            px: 1,
                            py: 0.5,
                            borderRadius: 1,
                            backgroundColor: theme.palette.primary.light,
                            color: 'white',
                          }}
                        >
                          {tech}
                        </Typography>
                      ))}
                    </Box>
                    <Box sx={{ display: 'flex', gap: 1 }}>
                      <Button
                        variant="contained"
                        startIcon={<GitHubIcon />}
                        href={project.github}
                        target="_blank"
                        sx={{
                          background: `linear-gradient(45deg, ${theme.palette.primary.main}, ${theme.palette.secondary.main})`,
                        }}
                      >
                        GitHub
                      </Button>
                      <Button
                        variant="outlined"
                        startIcon={<LaunchIcon />}
                        href={project.demo}
                        target="_blank"
                      >
                        Live Demo
                      </Button>
                    </Box>
                  </CardContent>
                </Card>
              </motion.div>
            </Grid>
          ))}
        </Grid>
      </Paper>
    </motion.div>
  );
};

export default Projects;
